import React from 'react';
import GuestList from './GuestList'; // Agregando el componente para listar invitados
import AddGuestForm from './AddGuestForm'; // Agregando el componente para agregar invitados
import ModifyGuestForm from './ModifyGuestForm'; // Agregando el componente para modificar invitados
import DeleteGuestForm from './DeleteGuestForm'; // Agregando el componente para eliminar invitados

const App = () => {
  return (
    <div>
      <h1>Control de Invitados</h1>
      <AddGuestForm />
      <ModifyGuestForm />
      <DeleteGuestForm />
      <GuestList />
    </div>
  );
};

export default App;
